import React from 'react';
import Card from './Card';
import Sdata from './Sdata';

const Fav='dog';

const Series = () =>{
if(Fav==='laptop'){
    return(
        <Card 
        key={Sdata[0].id}
        imagesrc={Sdata[0].imagesrc}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        link={Sdata[0].link} 
        />
        );
}else
{
    return(
        <Card 
        key={Sdata[4].id}
        imagesrc={Sdata[4].imagesrc}
        title={Sdata[4].title}
        sname={Sdata[4].sname}
        link={Sdata[4].link} 
        />
        );
}
}


const App = () => (
    <>
    <Series />
    </>
);
 export default App;
